import React from "react";
import ReactDOM from "react-dom";
import Add from "./componant/Cal";
ReactDOM.render(
  <>
    <ol>
      <li> Addition Of Two Number is {Add(3, 4)}</li>
      <li> Substraction Of Two Number is {Sub(3, 4)}</li>
      <li> Multiplication Of Two Number is {Mult(3, 4)}</li>
      <li> Division Of Two Number is {Div(3, 4)}</li>
    </ol>   
  </>,
  document.getElementById('root')

);
